import React from 'react';
import './HowToUse.css';

const HowToUse = () => {
  return (
    <div className="container">
      <h1>About Page</h1>
      <p className="text-justify slide-in">
        Aplikasi Menghitung Probabilitas Tabrakan Pesawat Terbang adalah sebuah sistem yang memungkinkan pengguna untuk menghitung probabilitas tabrakan antara pesawat terbang. Dengan menggunakan aplikasi ini, pengguna dapat memperoleh pemahaman yang lebih baik tentang risiko tabrakan pesawat terbang dalam suatu area tertentu. Hal ini dapat membantu pengguna dalam mengambil keputusan yang berkaitan dengan navigasi dan keselamatan penerbangan.
      </p>
    </div>
  );
};

export default HowToUse;
